import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../actions/authActions";
import { Container, Row, Col, Carousel } from "react-bootstrap";
import Fade from "react-reveal";
import image1 from "../image1.jpeg";
import Footer from "../components/Footer";

import Navigation from "../components/Navigation";

class Dashboard extends Component {
  onLogoutClick = (e) => {
    e.preventDefault();
    this.props.logoutUser();
  };
  render() {
    const { user } = this.props.auth;
    return (
      <>
        {/* General notes about this page: I don't really like the layout of the first section. It could
    definitely be improved. The second section with the "beliefs" I think makes a lot of sense to add.
    I got those words from the consitution of the club. I like the icons too.  */}
        <script
          src="https://kit.fontawesome.com/a17da011a4.js"
          crossorigin="anonymous"
        ></script>
        <div className="secondary-nav">
          <Navigation></Navigation>
          <div className="header-text">
            <Container>
              <Row>
                <p className="heading-about">
                  WELCOME, {user.name.split(" ")[0]}
                </p>
              </Row>
            </Container>
          </div>
        </div>
        <br />
        <div className="d-flex justify-content-center">
          {/* After a little research I think adding these classnames aren't a good way to style the page.
    I originally wanted the last columns in the grid to be center aligned, but I think that
    A) looks worse and B) is unneccesary, so perhaps not doing this is better */}
          <Container className="about-intro">
            <Fade>
              <Row>
                <Col>
                  <br />
                  <p className="about-header text-uppercase text-center">
                    100 Years of Slashing, Parrying, Stabbing, and Reposting
                  </p>
                </Col>
              </Row>
              <br />
              <br />
              <Row className="image-row-1">
                <Col>
                  <h3>Snackwave Asymmetrical Readymade.</h3>
                  <br />
                  <p>
                    Pitchfork blue bottle street art, aesthetic slow-carb
                    locavore twee leggings forage. Street art cold-pressed
                    try-hard, tbh messenger bag asymmetrical selvage poke trust
                    fund jianbing tumeric health goth gastropub edison bulb.
                    90's marfa cloud bread twee banjo selvage helvetica everyday
                    carry art party hell of neutra.
                  </p>
                  <br />
                </Col>
                <Col>
                  <img src={image1} width="653px" />
                </Col>
              </Row>
              <br />
              <br />
            </Fade>
            <br />
            <hr></hr>
            <br />
            <br />
            <Container className="fencing-carousel">
              <Carousel>
                <Carousel.Item>
                  <img
                    className="d-block w-100"
                    src={image1}
                    alt="First slide"
                  />
                </Carousel.Item>
                <Carousel.Item>
                  <img
                    className="d-block w-100"
                    src={image1}
                    alt="Second slide"
                  />
                </Carousel.Item>
                <Carousel.Item>
                  <img
                    className="d-block w-100"
                    src={image1}
                    alt="Third slide"
                  />
                </Carousel.Item>
              </Carousel>
            </Container>
            <br />
            <br />
            <hr></hr>
            <div className="work-improvement">
              <Fade>
                <h2>OUR BELIEFS</h2>
                <br />
                <br />
                <Row>
                  <Col>
                    <i class="fas fa-hands-helping fa-3x"></i>
                    <h2>Sportsmanship.</h2>
                    <br />
                    <p>
                      Banjo chillwave PBRB neutra stumptown kinfolk put a bird
                      on it flexitarian cliche chia. Activated charcoal ethical
                      affogato iPhone. Locavore four dollar toast vinyl prism
                      retro. +1 taiyaki cardigan pug. YOLO plaid cardigan austin
                      edison bulb.
                    </p>
                  </Col>
                  <Col>
                    <i class="fas fa-running fa-3x"></i>
                    <h2>Athleticism.</h2>
                    <br />
                    <p>
                      Banjo chillwave PBRB neutra stumptown kinfolk put a bird
                      on it flexitarian cliche chia. Activated charcoal ethical
                      affogato iPhone. Locavore four dollar toast vinyl prism
                      retro. +1 taiyaki cardigan pug. YOLO plaid cardigan austin
                      edison bulb.
                    </p>
                  </Col>
                  <Col>
                    <i class="fas fa-hammer fa-3x"></i>
                    <h2>Improvement.</h2>
                    <br />
                    <p>
                      Banjo chillwave PBRB neutra stumptown kinfolk put a bird
                      on it flexitarian cliche chia. Activated charcoal ethical
                      affogato iPhone. Locavore four dollar toast vinyl prism
                      retro. +1 taiyaki cardigan pug. YOLO plaid cardigan austin
                      edison bulb.
                    </p>
                  </Col>
                  <Col>
                    <i class="fas fa-users fa-3x"></i>
                    <br />
                    <h2>Community.</h2>
                    <br />
                    <p>
                      Banjo chillwave PBRB neutra stumptown kinfolk put a bird
                      on it flexitarian cliche chia. Activated charcoal ethical
                      affogato iPhone. Locavore four dollar toast vinyl prism
                      retro. +1 taiyaki cardigan pug. YOLO plaid cardigan austin
                      edison bulb.
                    </p>
                  </Col>
                </Row>
              </Fade>
            </div>
          </Container>
        </div>
        <Footer></Footer>
      </>
      //   <div style={{ height: "75vh" }} className="container valign-wrapper">
      //     <div className="row">
      //       <div className="col s12 center-align">
      //         <h4>
      //           <b>Hey there,</b> {user.name.split(" ")[0]}
      //           <p className="flow-text grey-text text-darken-1">
      //             You are logged into a full-stack{" "}
      //             <span style={{ fontFamily: "monospace" }}>MERN</span> app 👏
      //           </p>
      //         </h4>
      //         <button
      //           style={{
      //             width: "150px",
      //             borderRadius: "3px",
      //             letterSpacing: "1.5px",
      //             marginTop: "1rem",
      //           }}
      //           onClick={this.onLogoutClick}
      //           className="btn btn-large waves-effect waves-light hoverable blue accent-3"
      //         >
      //           Logout
      //         </button>
      //       </div>
      //     </div>
      //   </div>
    );
  }
}

Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};
const mapStateToProps = (state) => ({
  auth: state.auth,
});
export default connect(mapStateToProps, { logoutUser })(Dashboard);
